import React, { Component } from 'react'

class Home extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div className="home">
                <div>Welcome to your Home page</div>
                <h1> Status:{this.props.loggedIn}</h1>
                <h1>User: {this.props.user}</h1>
            </div>
        );
    }
}
export default Home
